import React from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { Grid } from '@material-ui/core';

import Nav from '../../components/Navigation/Nav';
import Intro from '../../components/Home/Intro';
import Tech from '../../components/Home/Tech';
import Why from '../../components/Home/Why';

import BG from './imgs/reset.jpg';
import TopRight from './imgs/1x/TopRight.png';
import BottomRight from './imgs/1x/BottomRight.png';

const useStyles = makeStyles((theme) => ({
    container: {
        backgroundImage: `url(${BG})`,
        backgroundSize: 'cover',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'flex-start',
    },
    topDiv: {
        height: 160,
        backgroundImage: `url(${TopRight})`,
        backgroundSize: 'cover',
    },
    tech: {
        height: '150vh',
        backgroundColor: 'white',
    },
    bottomDiv: {
        height: 160,
        backgroundImage: `url(${BottomRight})`,
        backgroundSize: 'cover',
    },
}));

const Home = () => {

    const classes = useStyles();

    return (
        <Grid className={classes.container} container>

            <Nav />

            <Intro />

            <Grid className={classes.topDiv} item xs={12}></Grid>

            <Tech />

            <Why />

            <Grid className={classes.bottomDiv} item xs={12} ></Grid>

        </Grid>
    );
};

export default Home;
